import Link from "next/link";

const PostLink = props => (
  <li>
    <Link href="/p/[id]" as={`/p/${props.x}`}>
      <a>{props.x}</a>
    </Link>
  </li>
);

export default function Blog() {
  return (
    <>
      <h1>My Blog</h1>
      <ul>
        <PostLink x="hello-nextjs" />
        <PostLink x="learn-nextjs" />
        <PostLink x="deploy-nextjs" />
      </ul>
    </>
  );
}
